import { Routes, Route } from 'react-router-dom';
import {autoLogin} from './components/utils/fetchs'

function App() {
  useEffect(()=> {

  })
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Landing/>}>
          <Route index element={<LandingBody/>}/>
          <Route path='contact-us' element={<ContactUs/>}/>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
